import React, { useEffect, useState } from 'react'

const Games = () => {
    const [games, setgames] = useState([])
    useEffect(() => {
        axios.get("http://localhost:5000/game")
            .then((res) => {
                setgames(res.data)
                console.log(games)
            })
            .catch(err => console.log(err))
    }, [])
    return (
        <div className="container">
            <div className="row">
                {
                    games.map((game) => <h1>hello</h1>)
                }
            </div>
        </div >
    )
}

export default Games
